/**
 * Advent of Code - Day 5
 * Alchemical Reduction: https://adventofcode.com/2018/leaderboard/day/5
 */

const input = ''

/**
 * Part One
 */

// Loops through an input to 
// remove matching character
// patterns with regex
const reactor = input => {
  let reacting = true

  while (reacting) {
    // Store current input for comparison
    let initialInput = input

    for (i = 0; i < input.length; i++) {
      // Determine character case and regex
      const char = input.charAt(i)
      const pattern = char + (char === char.toUpperCase() ? char.toLowerCase() : char.toUpperCase())
      const regex = new RegExp(pattern, 'g')

      // Replace any matching characters
      input = input.replace(regex, '')
    }

    // See if the inputs match
    if (initialInput === input) {
      reacting = false
    } else {
      reacting = true
    }
  }

  // Return the output length
  return input.length
}

// Part One
console.log('Part One:', reactor(input))


/**
 * Part Two
 */

// Reduces an input, running each unique character 
// through the above reactor, storing the result 
// lengths and returning the shortest
const improvedReactor = input => {
  const result = input.split('').reduce((acc, cur, i, arr) => {
    // Only run letters than have not been calculated
    if (!acc[cur.toLowerCase()]) {
      // Log letter to track progress
      console.log('Searching:', cur.toLowerCase())

      // Generate the new input without the cur character
      let regex = new RegExp(cur.toLowerCase(), 'gi')
      let newInput = input.replace(regex, '')

      // Get the reaction length
      acc[cur.toLowerCase()] = reactor(newInput)
    }

    return acc
  }, {})

  // Find the lowest item length
  let topKey
  let topValue = 10000
  Object.entries(result).forEach(([key, value]) => {
    if (value < topValue) {
      topKey = key
      topValue = value
    }
  })

  return {topKey, topValue}
}

console.log('Part Two:', improvedReactor(input))
